import React, { Component } from 'react'
import { timePeriodList } from '../../statics/timePeriodList'

class AlpStyleSelect extends Component {
    render() {
        const {setTimePeriod} = this.props
        return (

                <select name="timePeriod" id="workingPieceTimePeriod" onChange={(event) => setTimePeriod(event.target.value)}>
                    {
                        timePeriodList.map((timePeriod) =>{
                            <option value={timePeriod.key}>{timePeriod}</option>
                        })
                    }
                </select>

        )
    }
}
export default AlpStyleSelect;
